from PyPDF2 import PdfReader
from django.test import TestCase, override_settings
from django.core.files.uploadedfile import SimpleUploadedFile
from rest_framework.test import APIClient
from rest_framework import status
import base64
from ...models import Image, PDF
from PIL import Image as PILImage, UnidentifiedImageError


# Global variables for base64-encoded data
x = ""
y =""

@override_settings(MEDIA_URL='/media/')
class UploadFileTests(TestCase):
    def test_upload_image(self):
        """
        Test uploading a valid image file.
        """
        # Create a valid mock image file (PNG format)
        mock_image = SimpleUploadedFile(
            name='test_image.png',
            content=base64.b64decode(x),  # Decode the base64 data
            content_type='image/png'
        )
        base64_image = base64.b64encode(mock_image.read()).decode('utf-8')

        # Send a POST request to upload the image
        response = self.client.post(
            '/api/upload/',
            {'file': base64_image, 'type': 'image'},
            format='json'
        )

        # Print the error response if the status code is not 201
        if response.status_code != status.HTTP_201_CREATED:
            print("Error Response (Image Upload):", response.data)

        # Verify the response
        self.assertEqual(response.status_code, status.HTTP_201_CREATED)
        self.assertIn('file', response.data)
        self.assertTrue(response.data['file'].startswith('/media/images/'))
        self.assertTrue(response.data['file'].endswith('.png'))

        # Verify image metadata
        pil_image = PILImage.open(mock_image)
        self.assertEqual(response.data['width'], pil_image.size[0])  # Width of the mock image
        self.assertEqual(response.data['height'], pil_image.size[1])  # Height of the mock image
        self.assertEqual(response.data['channels'], len(pil_image.getbands()))  # Channels of the mock image

    def test_upload_pdf(self):
        """
        Test uploading a valid PDF file.
        """
        # Create a valid mock PDF file
        mock_pdf = SimpleUploadedFile(
            name='test_pdf.pdf',
            content=base64.b64decode(y),  # Decode the base64 data
            content_type='application/pdf'
        )
        base64_pdf = base64.b64encode(mock_pdf.read()).decode('utf-8')

        # Send a POST request to upload the PDF
        response = self.client.post(
            '/api/upload/',
            {'file': base64_pdf, 'type': 'pdf'},
            format='json'
        )

        # Print the error response if the status code is not 201
        if response.status_code != status.HTTP_201_CREATED:
            print("Error Response (PDF Upload):", response.data)

        # Verify the response
        self.assertEqual(response.status_code, status.HTTP_201_CREATED)
        self.assertIn('file', response.data)
        self.assertTrue(response.data['file'].startswith('/media/pdfs/'))
        self.assertTrue(response.data['file'].endswith('.pdf'))

        # Verify PDF metadata
        pdf_reader = PdfReader(mock_pdf)
        self.assertEqual(response.data['num_pages'], len(pdf_reader.pages))  # Number of pages in the mock PDF
        self.assertEqual(response.data['page_width'], pdf_reader.pages[0].mediabox.width)  # Page width of the mock PDF
        self.assertEqual(response.data['page_height'], pdf_reader.pages[0].mediabox.height)  # Page height of the mock PDF

    def test_upload_missing_file(self):
        """
        Test uploading without providing a file.
        """
        # Send a POST request without the 'file' field
        response = self.client.post(
            '/api/upload/',
            {'type': 'image'},
            format='json'
        )

        # Verify the response
        self.assertEqual(response.status_code, status.HTTP_400_BAD_REQUEST)
        self.assertEqual(response.data['error'], "File data is required")

